    "2013-03-16T00:53:07.591003",nt"name": "washington-geothermal-area-features",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset is a compilation of geothermal
    area features from sources in Washington state, provided by the Washington Division
    of Geology and Earth Resources and published as a web feature service, a web map
    service, an ESRI service, and as a downloadable Excel file for the National Geothermal
    Data System. The package contains a personal geodatabase (Access Database) with
    11 tables, 10 of which should not be edited.  The table GeothermalAreas contains
    the geometry and shape information for display using GIS software. Fields in the
    GeothermalAreas data table include OBJECTID, GeothermalAreaURI, FieldName, OtherLocationName,
    Notes, ResourceType, GeologicSetting, GeothermTempCharacterization, LandOwner, County,
    State, Source and SourceURI.In addition to the database, a Microsoft Word Document
    containing metadata is included with the data set and is directly from the data
    provider.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
